import React, { useState, useEffect } from 'react'
import Users from './Users';
import { useLocation } from 'react-router-dom';
import Navbar from '../admin_component/navbar';
function UserForm() {

    const location = useLocation()
    const user = location.state
    console.log(user)
    const [userdata, setUserdata] = useState([]);
    const getUserdata = async () => {
        try {
            const req = await fetch("http://localhost:3001/users");
            const resData = await req.json();
            if (resData.length > 0) {
                setUserdata(resData);
            }
        } catch (e) {
            console.log(e);
        }
    }
    useEffect(() => {
        getUserdata();
    }, []);


    return (
        <div>
            <div class="for w-100">
                <div class="container-fluid">
                    <Navbar />
                    <React.Fragment>
                        <div class=" p-3 overflow-auto" style={{ height: '100vh' }}>
                            <div className="App">
                                <div className='container'>
                                    <div className='row'>
                                        <div className='col-md-8'>
                                            <table className='table' style={{ marginTop: '10%' }}>
                                                <thead className="table bg-primary bg-midnight-blue" >
                                                    <tr >
                                                        <th>Sno</th>
                                                        <th>Domain Name</th>
                                                        <th>Training Name</th>
                                                        <th>Start Date</th>
                                                        <th>End Date</th>
                                                        <th>Available Seats</th>
                                                        <th></th>
                                                    </tr>
                                                </thead>
                                                <tbody>
                                                    <Users usersData={userdata} />
                                                </tbody>

                                            </table>
                                        </div>
                                    </div>
                                </div>
                            </div></div>
                    </React.Fragment>

                </div>
            </div>
        </div>
        
    );
}

export default UserForm;
